import React from "react";

const Navbar = () => {
  return (
    <header className="header">
      <a href="/" className="logo">
        Logo
      </a>

      <nav className="navbar">
        <a href="/">Home</a>
        <a href="/">About</a>
        <a href="/">Portfolio</a>
        <a href="/">Services</a>
        <a href="/">Contact</a>
      </nav>
    </header>
  );
};

export default Navbar;
